import React from "react";
import "./Header.css";

function Header() {
  return (
    <div className="header">
      <nav>
        <img
          className="header_logo"
          src="https://www.pngitem.com/pimgs/m/117-1170427_hospital-logo-red-cross-hd-png-download.png"
        />

        <div className="header_nav">
          <div className="header_option">
            <span className="header_optionOne">LOGIN</span>
          </div>
          <div className="header_option">
            <span className="header_optionOne"> ABOUT</span>
          </div>
          <div className="header_option">
            <span className="header_optionOne">CONTACT US</span>
          </div>
        </div>
      </nav>
    </div>
  );
}

export default Header;
